import React from "react";
import { Component } from 'react';
import { useLocation } from "react-router-dom";

const Temp = () => {
    const location = useLocation();
    console.log(location.state.name)
    return (
      <div>
          {location.state.name}
          {this.props.account}
      </div>
    )
  }
  export default Temp
